// This is an example of a functional component.

import React from 'react'
import { Header, Container } from 'semantic-ui-react'

const AboutPage = () => {
    return (
        <Container>
            <Header as='h2'>About MyTTF</Header>
            <p>
                MyTTF is an ap
            </p>
        </Container>
    )
}

export default AboutPage
